<template>
    <section class="al-elite-group">
        <HeaderBar :header-config="headerConfig" v-if="headerOnOff"></HeaderBar>
        <EliteTitleBar :config="titleConfig" class="elitePurposeTitle"></EliteTitleBar>
        <ElitePurposeCard></ElitePurposeCard>
        <EliteTitleBar :config="detailTitleConfig" class="eliteSeatTitle"></EliteTitleBar>
        <EliteSeat
                :config="{
                    doctorName:'王岩',
                    isTop:1,
                    cid:'1397640872703',
                    position:'主席',
                    company:'中国人民解放军总医院',
                    imageUrl:'data:image/png;base64,'
                 }"
        ></EliteSeat>
        <EliteViceSeat></EliteViceSeat>
        <EliteViceSeatList></EliteViceSeatList>
    </section>
</template>
<script>
    import EliteSdk from '../untils/eliteCommSdk';
    import HeaderBar from '../../../../components/HeaderBar/HeaderBar';
    import EliteTitleBar from './EliteTitleBar';
    import ElitePurposeCard from './ElitePurposeCard';
    import EliteSeat from './EliteSeat';
    import EliteViceSeat from './EliteViceSeat';
    import EliteViceSeatList from './EliteViceSeatList';
    import TempCache from "../../../../../static/js/tempcache";
    let userId = TempCache.getItem('userId');
    import {mapGetters,mapActions} from 'vuex';
    export default {
        components:{
            HeaderBar,
            EliteTitleBar,
            ElitePurposeCard,
            EliteSeat,
            EliteViceSeat,
            EliteViceSeatList
        },
        data(){
            return {
                titleConfig:{
                    title:'菁英会宗旨',
                    icon:false,
                    routerPath:'organization',
                    routerTitle:'查看详细'
                },
                detailTitleConfig:{
                    title:'菁英会组织人员',
                    icon:false,
                    routerPath:'member',
                    routerTitle:'查看详细'
                },
                headerConfig:{
                    title:"组织概况",  //  *标题项
                    share:{            // ..自定义分享项
                        onOff:true,
                        params: {
                            "sceneType": "91",
                            customer:userId,
                            visitSiteId:2
                        }
                    },
                    feedback: {         //..自定义反馈项
                        onOff: false
                    },
                    backOnOff:true
                }
            }
        },
        computed:{
            ...mapGetters(['organizationName']),
            headerOnOff(){
                return !EliteSdk.appPort;
            }
        },
        watch:{
            organizationName(){
                let _this = this;
                EliteSdk.setTitle({
                    seoTitle:_this.organizationName+`的学术报道-唯医骨科,allinmd`,
                    title:"组织概况"
                });
            }
        },
        mounted(){
            let _this = this;
            EliteSdk.setTitle({
                seoTitle:_this.organizationName+`的组织概况-唯医骨科,allinmd`,
                title:"组织概况"
            });
            setTimeout(()=>{
                $(".al-elite-liveDes .dot").each(function(){
                    let isThisElement = $(this);
                    isThisElement.width(isThisElement.height());
                    isThisElement.css({"borderRadius":'50%'});
                });
            },300);
        }

    }
</script>